descriptions:
{'es-ES': 'Apartamento muy luminoso, tranquilo y con vistas al pico Almonga y la Iglesia. A 5 minutos del centro del pueblo. Completamente amueblado y listo para habitar. Suelo de cerámica duradero y de fácil mantenimiento. Además del piso de 80 metros, el precio incluye un local amplio de más de 40 metros que se encuentra en la planta baja en el que se podría hacer un loft o poner un negocio. 

Nota: el valor del certificado energético y escala de eficiencia está en trámite.
Contacto preferiblemente por teléfono.'}

{'es-ES': 'REF: 287   PISO EN VENTA EN AVENIDA VALLADOLID

La vivienda necesita reforma y consta de 3 habitaciones, 2 baños, cocina, salón, terraza, ascensor y plaza de garaje.

Esta cerca de supermercados, colegios,centro deportivos, farmacias, paradas de autobús, zonas verdes,...'}

{'es-ES': ' EUROPA PROPERTY REAL ESTATE, vende en el coqueto pueblo de CASTRO MOCHO (PALENCIA) , vivienda de 433 metros, dentro de una parcela de 600 metros, con una gran entrada, salón grande exterior, con vistas al patio. En esta planta además dispone de 2 dormitorios,  amplia cocina con dispensa y un baño grande, todo exterior. Planta superior con tres dependencias por acabar, donde se situarían los dormitorios, baños, salón. El patio es llano y muy grande , de 338 metros. En el exterior de la vivienda hay dos trasteros grandes y en el sótano una gran bodega, con una temperatura media de 12 grados. Terraza enorme y aparcamiento para varios coches. A 15 minutos de la ciudad, muy bien conectada con carreteras es una  zona con mucha tranquilidad, donde se puede tener un gran hogar.

La información expuesta es meramente informativa.
'}

{'es-ES': '"Piso a estrenar muy soleado y con vistas. Vivienda compuesta por un salón comedor con orientación sur. 3 habitaciones. cocina exterior. 2 baños. También cuenta con plaza de garaje y trastero en el mismo edificio"
Buena calidad de construcción.

¡Visitelo hoy mismo!'}

{'es-ES': 'Casa de pueblo en Autillo de Campos, municipio situado a 30 Km de Palencia y 70 Km de Valladolid. La casa fue construida a principios del siglo XX. Tiene dos plantas dedicadas a vivienda de unos 150 m2 cada planta. Dispone de 5 habitaciones, sala de estar, cocina, comedor, despensas, trastero y baño.
Además de la vivienda se construyeron también las dependencias propias para atender las faenas agrícolas: cuadra, pozo, pila, pajar, paneras, media nave, portalón y corral. El total del terreno ocupa unos 650 m2.

Los tejados han sido reformados con onduline hace 4 años y el año pasado se cambiaron las tuberías del baño y la puerta de entrada a la casa. Se ha asfaltado toda la zona de delante de la casa. La vivienda tiene línea de teléfono, TV, puertas de madera maciza, muebles de época, paredes decoradas con pinturas naif de la época. Buen estado de conservación, muchas posibilidades. Mejor visitar, sin compromiso.'}

{'es-ES': 'Se vende esta acogedora finca de 1500 m2 de terreno. Ideal para familias que estén buscando una  casa con mucho terreno para poder disfrutar en familia. 

La casa tiene en la planta principal, un estupendo salón comedor muy soleado con una chimenea,  2 habitaciones, una cocina amplia con espacio suficiente para comer varias personas. En el sótano  hay bodega y posibilidad de terminar de construir mas habitaciones con baños.

Para ampliar información no dude en llamarnos.'}

{'es-ES': 'Estupenda casa de una sola planta para entrar a vivir, en Espinosa de Villagonzalo, localidad y municipio de la provincia de Palencia, ( Castilla y león) a cinco km de Osorno La Mayor.

Cuenta la casa con hall de entrada, tres dormitorios, cocina, sala de estar, baño, cocina de verano y un pequeño patio. Todas las ventanas nuevas de climalit.

EXCELENTE OPORTUNIDAD!!'}

{'es-ES': 'Se vende Casa ubicada en Alar del Rey, provincia Palencia, vivienda de verano, de dos pisos, cada vivienda consta de dos habitaciones, cocina, cuarto de baño y sala, tambien dispone de un trastero, mas u nterreno de 135 metros cuadrados parte trasera de la casa.
El pueblo esta situado por autopista de Bilbao a dos horas, es un pueblo que tiene un gran río, dispone de piscinas munipales, frontom, farmacia y cafeterias varias.

PRECIO NEGOCIABLE!'}

{'es-ES': 'Muy buen Piso en Avenida Cardenal Cisneros, Zona con todos los Servicios, Colegios, Centros Deportivos, Comercios, Supermercados, Farmacia, Centro de Salud, Transportes, Bien Comunicado.
Consta de 88 m2 con un Salón Comedor Amplio, Cocina Comedor Totalmente Equipada, Amueblada y Completa con Vitrocerámica, Horno, Microondas, muchos Electrodomésticos, TRES Habitaciones, Un Baño Completo, Suelos Parquet, Balcón Terraza, Exterior, Ascensor, Calefacción, Oportunidad!!!

Para más información, no dude en llamarnos!!!'}

{'es-ES': 'Esta perfecto estado ,para entrar a vivir
Zona tranquila con zonas verdes sin ruidos autobuses cada 14 minutos,todos los servicios.
EL PISO SE DEJA TOTALMENTE AMUEBLADO TODO PARA ENTRAR A VIVIR&quot;
GARAJE PLAZA AMPLIA Y FÁCIL Y TRASTERO MUY GRANDE.'}

{'es-ES': 'Venta de piso en zona San Miguel, calle Portillo de Doña María. La vivienda tiene 142,48 m2 construidos y 108,17 m2 útiles, los cuales se distribuyen en amplio salón - comedor con acceso a terraza, cocina, 4 dormitorios, dos baños y tendedero. 

La vivienda tiene tres armarios empotrados en 2 dormitorios, los suelos son de parquet de roble y de terrazo amarmolado. Calefacción y agua central. Edificio con ascensor. La comunidad tiene portero y los gastos de comunidad son de 135 € mensuales. 

La vivienda se encuentra en pleno centro de Palencia con vistas a la Torre de San Miguel y a escasos minutos del parque Isla Dos Aguas.'}

{'es-ES': 'Chalet adosado en Guardo, para entrar a vivir, en una de las zonas más tranquilas, rodeado de naturaleza pero con todos los servicios cercanos (colegio, farmacia,... )

Dispone de garaje privado, tres habitaciones, cocina espaciosa, amplio salón con grandes ventanales con mucha entrada de luz, baño con bañera y un aseo. En la parte exterior, cuenta con un pequeño patio delantero de acceso, y un patio trasero.

Si esta es la casa que buscas, no dudes en ponerte en contacto para más información o para visitarla sin compromiso.'}

{'es-ES': 'EXCELENTE INVERSIÓN CON ASCENSOR. Venta de piso en avenida Reyes Católicos. La vivienda tiene 94,31 m2 construidos y 78,67 m2 útiles los cuales se distribuyen en salón-comedor, cocina, 3 dormitorios, baño y terraza.

Los suelos son de parquet. Agua caliente con termo eléctrico. El edificio tiene ascensor. Trastero.

La vivienda es totalmente exterior y gracias a su orientación sur es muy luminosa. Se encuentra en una zona tranquila a tan solo unos minutos de una de las grandes avenidas de Palencia Cardenal Cisneros.'}

{'es-ES': 'Si estás buscando un piso económico con ascensor, en zona tranquila con todos los servicios a tu alcance, esta es tu oportunidad. 

La vivienda es soleada junto al centro de salud Eras del Bosque, tiene 72 m2 construidos y 60 m2 útiles los cuales se distribuye en salón-comedor, dos dormitorios, cocina, baño y amplia terraza con vistas a centro de salud.

La vivienda tiene una carbonera. El edificio tiene ascensor y el portal ha sido reformado. Los gastos de comunidad son de 40 €/mes. No deje pasar la oportunidad de comprar esta vivienda con muchas posibilidades.'}

{'es-ES': 'EXCELENTE PISO EN VENTA DE BAÑOS! Piso de 84 m² muy bien distribuidos, en muy buen estado para entrar a vivir. Se compone de salón, 3 dormitorios, 1 baño y cocina independiente. Calefacción individual. Totalmente exterior y muy luminoso, con zona verde tranquila frente a la vivienda.

Ubicado en una zona muy céntrica, frente al ayuntamiento, próximo al centro de salud, farmacia, supermercados, bancos, comercios, polideportivo.

Muy bien comunicado con autobús a Palencia en la puerta de casa. Posibilidad de venta garaje (no incluido en el precio del anuncio) en edificio cercano a la vivienda.'}

{'es-ES': 'Finca rústica con corral situada en la población Valle de Cerrato.
257 metros cuadrados de los cuales 70 metros cuadrados corresponden a la casa ya construidos , con 3 plantas. El resto corresponden a corral , cochera y anexo a la casa.

Precio Negociable'}
